def print_round_diff_table2(p_index):
    print(f"\n Wahrscheinlichkeit von Sieg für p={-round_scores[p_index]}, wenn Kategorie unter ersten 8 vorliegt\n")
    print("<script>\ncreateFilterableTable(`")
