    for i, (hand_cat) in enumerate(hand_categories):
        res_line = f"{hand_category_to_string(hand_cat)}"
        for gt in [True, False]:
            for ds in range(2):
                if ds == 1:
                    res_line += "/"

                prob_gr = 0.
                prob_eq = 0.
                should_mark_prob = 0.
                for other_cat in range(80):
                    transition_prob = transition_matrix[i][other_cat]
                    rounds = np.sum(gt_calls_first14_by_cat[ds][other_cat]) if gt else np.sum(rounds_by_cat_first14[ds][other_cat])
                    if rounds < MIN_ROUNDS:
                        should_mark_prob += transition_prob
